import { Component, AfterViewInit } from '@angular/core';
import * as L from 'leaflet';
import { WeatherService } from '../../Services/weather.service';
import { CropService } from '../../Services/crop.service';

@Component({
  selector: 'app-weather',
  templateUrl: './weather.component.html'
})
export class WeatherComponent implements AfterViewInit {
  lat: number = 36.8;
  lon: number = 10.2;
  predictedCrop: string | null = null;
  weatherData: any = null;
  marker: L.Marker | null = null;

  soilData = {
    ph: 6.5,
    N: 0.3,
    P: 35,
    K: 50
  };

  constructor(
    private weatherService: WeatherService,
    private cropService: CropService
  ) {}

  ngAfterViewInit(): void {
    const map = L.map('map').setView([this.lat, this.lon], 6);

    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
      attribution: '&copy; OpenStreetMap contributors'
    }).addTo(map);

    map.on('click', (e: L.LeafletMouseEvent) => {
      this.lat = e.latlng.lat;
      this.lon = e.latlng.lng;

      if (this.marker) this.marker.remove();
      this.marker = L.marker([this.lat, this.lon]).addTo(map);

      this.fetchWeather(); // auto-fetch weather after selection
    });
  }

  fetchWeather() {
    this.weatherService.getWeather(this.lat, this.lon).subscribe({
      next: (data) => this.weatherData = data,
      error: (err) => console.error('Weather error:', err)
    });
  }

  onSubmit() {
    if (!this.weatherData) {
      alert("Please click on the map to select a location and fetch weather.");
      return;
    }

    const input = {
      K: this.soilData.K,
      N: this.soilData.N,
      P: this.soilData.P,
      ph: this.soilData.ph,
      humidity: this.weatherData.humidity,
      temperature: this.weatherData.temperature,
      rainfall: this.weatherData.rainfall
    };

    this.cropService.predictCrop(input).subscribe({
      next: (res) => this.predictedCrop = res.recommended_crop,
      error: (err) => console.error('Prediction error:', err)
    });
  }
}
<div class="container mx-auto px-4 py-6 space-y-6">

  <!-- Map section -->
  <div>
    <h2 class="text-xl font-semibold mb-2">üó∫ Select Location</h2>
    <div id="map" class="rounded border shadow" style="height: 400px;"></div>
    <p class="text-gray-600 mt-2">üìç Selected: {{ lat.toFixed(4) }}, {{ lon.toFixed(4) }}</p>
  </div>

  <!-- Weather Info -->
  <div *ngIf="weatherData" class="bg-blue-50 border border-blue-300 rounded p-4 shadow">
    <h3 class="text-lg font-semibold text-blue-800 mb-2">üå¶ Weather Data</h3>
    <div class="grid grid-cols-2 gap-2 text-blue-700">
      <p>üå° Temperature: {{ weatherData.temperature }} ¬∞C</p>
      <p>üíß Humidity: {{ weatherData.humidity }} %</p>
      <p>üåß Rainfall: {{ weatherData.rainfall }} mm</p>
    </div>
  </div>

  <!-- Soil Inputs -->
  <div class="bg-green-50 border border-green-300 rounded p-4 shadow">
    <h3 class="text-lg font-semibold text-green-800 mb-2">üå± Soil Parameters</h3>
    <div class="grid grid-cols-2 md:grid-cols-4 gap-4">
      <label class="block">
        <span class="text-sm">pH</span>
        <input [(ngModel)]="soilData.ph" type="number" step="0.1"
               class="input" placeholder="e.g. 6.8" />
      </label>
      <label class="block">
        <span class="text-sm">Nitrogen (N)</span>
        <input [(ngModel)]="soilData.N" type="number" step="0.01"
               class="input" placeholder="%" />
      </label>
      <label class="block">
        <span class="text-sm">Phosphorus (P)</span>
        <input [(ngModel)]="soilData.P" type="number"
               class="input" placeholder="mg/kg" />
      </label>
      <label class="block">
        <span class="text-sm">Potassium (K)</span>
        <input [(ngModel)]="soilData.K" type="number"
               class="input" placeholder="mg/kg" />
      </label>
    </div>
  </div>

  <!-- Submit -->
  <div class="text-center">
    <button (click)="onSubmit()"
            class="bg-emerald-600 hover:bg-emerald-700 text-white font-semibold py-2 px-4 rounded shadow">
      üöÄ Predict Best Crop
    </button>
  </div>

  <!-- Output -->
  <div *ngIf="predictedCrop" class="bg-yellow-50 border border-yellow-300 rounded p-4 shadow text-center">
    <h3 class="text-lg font-bold text-yellow-800">‚úÖ Recommended Crop:</h3>
    <p class="text-2xl font-semibold text-yellow-700 mt-2">{{ predictedCrop }}</p>
  </div>
</div>
